import React, { useState } from "react";
import "./Learning.style.css"; // Assuming you have a CSS file for styling
import Navbar from "../../header-footer/Header";

const videos = [
  {
    id: 1,
    title: "Video 1",
    description: "Description for video 1",
    duration: "10:00",
    uploadTime: "2023-01-01",
    thumbnail: "data:image/jpeg;base64,",
  },
  {
    id: 2,
    title: "Video 2",
    description: "Description for video 2",
    duration: "15:00",
    uploadTime: "2023-02-01",
    thumbnail: "data:image/jpeg;base64,",
  },
  // Add more video objects here
];

const Learning = () => {
  const [searchTerm, setSearchTerm] = useState("");

  const filteredVideos = videos.filter((video) =>
    video.title.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="learning">
      <Navbar />
      <h1>Learning Page</h1>
      <input
        type="text"
        placeholder="Search videos..."
        value={searchTerm}
        onChange={(e) => setSearchTerm(e.target.value)}
        className="learning__search-bar"
      />
      <div className="learning__videos">
        {filteredVideos.map((video) => (
          <div key={video.id} className="learning__video">
            <img
              src={video.thumbnail}
              alt={video.title}
              className="learning__thumbnail"
            />
            <div className="learning__details">
              <h2 className="learning__title">{video.title}</h2>
              <p className="learning__description">{video.description}</p>
              <p className="learning__duration">Duration: {video.duration}</p>
              <p className="learning__upload-time">
                Uploaded on: {video.uploadTime}
              </p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Learning;
